using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UITabBarDelegate_Protocol/index.html#//apple_ref/occ/intf/UITabBarDelegate	/// <summary>	/// The UITabBarDelegate protocol defines optional methods for a delegate of a UITabBar object. The UITabBar class provides the ability for the user to reorder, remove, and add items to the tab bar; this process is referred to as customizing the tab bar. The tab bar delegate receives messages when customizing occurs.	/// </summary>	[iOSVersion(2)]	public interface UITabBarDelegate	{		/// <summary>		/// Sent to the delegate before the customizing modal view is displayed.		/// </summary>		/// <param name="tabBar">The tab bar that is being customized.</param>		/// <param name="willBeginCustomizingItems">The items on the customizing modal view.</param>		[iOSVersion(2)]		[Export("tabBar")]		[Optional]		void TabBarPreBeginCustomzingItems(UITabBar tabBar, AnyObject[] willBeginCustomizingItems);				/// <summary>		/// Sent to the delegate after the customizing modal view is displayed.		/// </summary>		/// <param name="tabBar">The tab bar that is being customized.</param>		/// <param name="didBeginCustomizingItems">The items on the customizing modal view.</param>		[iOSVersion(2)]		[Export("tabBar")]		[Optional]		void TabBarPostBeginCustomizingItems(UITabBar tabBar, AnyObject[] didBeginCustomizingItems);				/// <summary>		/// Sent to the delegate before the customizing modal view is dismissed.		/// </summary>		/// <param name="tabBar">The tab bar that is being customized.</param>		/// <param name="willEndCustomizingItems">The items on the customizing modal view.</param>		/// <param name="changed">true if the visible set of items on the tab bar changed; otherwise, false.</param>		[iOSVersion(2)]		[Export("tabBar")]		[Optional]		void TabBarPreEndCustomizingItems(UITabBar tabBar, AnyObject[] willEndCustomizingItems, bool changed);				/// <summary>		/// Sent to the delegate after the customizing modal view is dismissed.		/// </summary>		/// <param name="tabBar">The tab bar that is being customized.</param>		/// <param name="didEndCustomizingItems">The items on the customizing modal view.</param>		/// <param name="changed">true if the visible set of items on the tab bar changed; otherwise, false.</param>		[iOSVersion(2)]		[Export("tabBar")]		[Optional]		void TabBarPostEndCustomizingItems(UITabBar tabBar, AnyObject[] didEndCustomizingItems, bool changed);				/// <summary>		/// Sent to the delegate when the user selects a tab bar item. (required)		/// </summary>		/// <param name="tabBar">The tab bar that is being customized.</param>		/// <param name="didSelectItem">The tab bar item that was selected.</param>		[iOSVersion(2)]		[Export("tabBar")]		[Optional]		void TabBarDidSelectItem(UITabBar tabBar, UITabBarItem didSelectItem);	}}